    "2015-07-08T19:06:22.364295",nt"name": "antarctic-1-km-digital-elevation-model-dem-from-combined-ers-1-radar-and-icesat-laser-sate",nt"isopen":
    true,nt"url": null,nt"notes": "This data set provides a 1 km resolution
    Digital Elevation Model (DEM) of Antarctica. The DEM combines measurements from
    the European Remote Sensing Satellite-1 (ERS-1) Satellite Radar Altimeter (SRA)
    and the Ice, Cloud, and land Elevation Satellite (ICESat) Geosciences Laser Altimeter
    System (GLAS). The ERS-1 data are from two long repeat cycles of 168 days initiated
    in March 1994, and the GLAS data are from 20 February 2003 through 21 March 2008.
    The data set is approximately 240 MB comprised of two gridded binary files and two
    Environment for Visualizing Images (ENVI) header files viewable using ENVI or other
    similar software packages. The data are available via FTP.",nt"license_title":
